import { Link } from 'react-router-dom'
// import PriorityDisplay from '../PriorityDisplay'
// import StatusDisplay from '../StatusDisplay'
import DeleteBlock from '../DeleteBlock'

const ExpenseCard = ({color, amount, expense, concept}) => {
    return (
        <div className='m-2 flex jus'>
        <Link to={`/ticket/${expense.documentId}`}>
            <div className='flex flex-row m-1 justify-center w-full justify-between'>
                <h3 className='font-medium text-lg'>{expense.subindex}</h3>
                <p className='m-2'>${expense.amount}</p>
                 <p className='m-2'>{expense.concept}</p>
                 <p>Timestamp</p>
                {/*<p className='m-2'>{expense.timestamp}</p> */}
            </div>
            {/* <PriorityDisplay/>
            <StatusDisplay/> */}
        </Link>
        <DeleteBlock/>
        </div>
    )
}

export default ExpenseCard
